    false,nt"url": null,nt"notes": "The U.S. Fish and Wildlife Service conducted
    a walrus harvest, health and welfare study in 5 northern Bering Sea coastal villages
    during the Spring of 1981. Goals of the study were to determine the level of harvest,
    age structure of harvested animals, body condition of harvested animals and levels
    of contaminants occurring in various body organs and tissues. Walrus harvest levels
    for the Nome area and King Island were determined to be 449-489 and 264-269 respectively.
    Thirty-two tooth samples were acquired and await analysis. Blubber and skin measurements
    were obtained for 11 animals. No contaminant samples were acquired. Secondary observations
    on weather conditions, chronology of harvest and socio-cultural-economic were noted.
    Intangible benefits derived from the study included a closer rapport with the resource
    users, greater information exchange and understanding of the Service's marine mammal
    goals and objectives, and greater understanding of the relationship of walrus to
    the subsistence, cultural and economic base.",nt"license_title": "License
